import { Form } from 'semantic-ui-react'

const Setting = () =>{
    return (
        <div>
            <Form>
                <Form.Group widths='equal'>
                    <Form.Input fluid id='form-subcomponent-shorthand-input-first-name' label='Ім`я' placeholder='Ім`я' />
                    <Form.Input fluid id='form-subcomponent-shorthand-input-last-name'label='Телефон'placeholder='Телефон'/>
                </Form.Group>
                <Button>Зберегти</Button>
            </Form>
        </div>
    )
}


export default Setting;
